        self.lineEdit_rendering_icon_hotspot.setToolTip(_translate("MilkMachine", "<html><head/><body><p><a name=\"hotspot\"/>&lt;hotSpot x=&quot;0.5&quot; y=&quot;0.5&quot; xunits=&quot;fraction&quot; yunits=&quot;fraction&quot;&gt; </p><p>Specifies the position within the Icon that is &quot;anchored&quot; to the &lt;Point&gt; specified in the Placemark. The <span style=\" font-style:italic;\">x</span> and <span style=\" font-style:italic;\">y</span> values can be specified in three different ways: as <span style=\" font-style:italic;\">pixels</span> (<span style=\" font-weight:600;\">&quot;pixels&quot;</span>), as <span style=\" font-style:italic;\">fractions</span> of the icon (<span style=\" font-weight:600;\">&quot;fraction&quot;</span><span style=\" font-style:italic;\">)</span>, or as <span style=\" font-style:italic;\">inset pixels </span>(<span style=\" font-weight:600;\">&quot;insetPixels&quot;</span>), which is an offset in pixels from the upper right corner of the icon. The <span style=\" font-style:italic;\">x</span> and <span style=\" font-style:italic;\">y</span> positions can be specified in different waysfor example, <span style=\" font-style:italic;\">x</span> can be in pixels and <span style=\" font-style:italic;\">y</span> can be a fraction. The origin of the coordinate system is in the lower left corner of the icon. </p><ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;\"><li style=\" margin-top:12px; margin-bottom:0px; margin-left:30px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">x </span>- Either the number of pixels, a fractional component of the icon, or a pixel inset indicating the <span style=\" font-style:italic;\">x</span> component of a point on the icon. </li><li style=\" margin-top:0px; margin-bottom:0px; margin-left:30px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">y </span>- Either the number of pixels, a fractional component of the icon, or a pixel inset indicating the <span style=\" font-style:italic;\">y</span> component of a point on the icon. </li><li style=\" margin-top:0px; margin-bottom:0px; margin-left:30px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">xunits </span>- Units in which the <span style=\" font-style:italic;\">x</span> value is specified. A value of <span style=\" font-weight:600;\">fraction</span> indicates the <span style=\" font-style:italic;\">x</span> value is a fraction of the icon. A value of <span style=\" font-weight:600;\">pixels</span> indicates the <span style=\" font-style:italic;\">x</span> value in pixels. A value of <span style=\" font-weight:600;\">insetPixels</span> indicates the indent from the right edge of the icon. </li><li style=\" margin-top:0px; margin-bottom:12px; margin-left:30px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">yunits</span> - Units in which the <span style=\" font-style:italic;\">y</span> value is specified. A value of <span style=\" font-weight:600;\">fraction</span> indicates the <span style=\" font-style:italic;\">y</span> value is a fraction of the icon. A value of <span style=\" font-weight:600;\">pixels</span> indicates the <span style=\" font-style:italic;\">y</span> value in pixels. A value of <span style=\" font-weight:600;\">insetPixels</span> indicates the indent from the top edge of the icon. </li></ul></body></html>", None))
